        \ `description`. \nFor example, given an Alias with members userA and userB:\
        \ \n* `additions: [userC]` results in [userA, userB, userC] \n* `removals:\
        \ [userB]` results in [userA] \n* `entries: [userC, user D]` results in [userC,\
